import React from "react";
import Posts from "./Posts";
import Comments from "./Comments";
import {BrowserRouter as Router, Route} from "react-router-dom";


function App() {
  
  return (
    <Router>
      <Route path="/" exact component={Comments} />
      
    </Router>
  );
}

export default App;
